			nStr += '';
			var comma = /,/g;
			nStr = nStr.replace(comma, '');
			x = nStr.split('.');
			x1 = x[0];
			x2 = x.length > 1 ? '.' + x[1] : '';
			var rgx = /(\d+)(\d{3})/;
			while (rgx.test(x1)) {
				x1 = x1.replace(rgx, '$1' + ',' + '$");
                WriteLiteral(@"2');
			}
			return x1 + x2;
		}
